import LocalizedStrings from "react-native-localization";
import en from "./en";
import es from "./es";

let strings = new LocalizedStrings({
  en: en,
  es: es,
});

// Set the initial language (e.g., defaulting to English)
strings.setLanguage('en');

export default strings;
